import withCounter1 from './withCounter'

class MouseClick1 extends Component {

    render() {

        const {increamentCounter, count} = this.props

    return( 
    <div>
        <button onClick={increamentCounter}>Counter {count} </button>
    </div>    
    )

  }
}

export default withCounter1(MouseClick1)
